        <div>
            <NavBar fixed="top" bg="dark" variant={"dark"} expand="lg">
                <Container>
                    <NavBar.Brand href="#">NewsSnake</NavBar.Brand>
                    <NavBar.Toggle aria-controls="navbarScroll" />
